import style from "./Authentication.module.css";
import React from "react";
import { useState } from "react";
import User from "./authState.js";
//import getInf from "./loginReq.js";

function Authentication(props) {
  const [login, setInput] = useState(""); // '' is the initial state value
  /*var login;
  let user = new User.constructor(login);*/
  //User.username = login;
  return (
    <div className={style.container}>
      <div>
        <div className={style.login_container}>
          <div className={style.input}>
            <div>
              <div>Login</div>
              <input
                value={login}
                onInput={(evt) => setInput(evt.target.value)}
                type="text"
              />
            </div>
            <div>
              <div>Password</div>
              <input type="text" />
            </div>
            <button onClick={console.log(User)} className={style.button}>
              Submit
            </button>
          </div>
        </div>

        <div></div>
      </div>
    </div>
  );
}
export default Authentication;
